import React, { useState } from "react";

const GrandChild = (props) => {
  return (
    <div>
      <h3>grandChild </h3>
      <Child brand={props.brand} />
    </div>
  );
};

const Child = (props) => {
  return (
    <div>
      <h2>Child :{props.brand} </h2>
    </div>
  );
};

const App = () => {
  const [brandname] = useState("Amazone");

  return (
    <div>
      <h1>App</h1>
      <Child brand={brandname} />
      <GrandChild />
    </div>
  );
};

export default App;
